import React from 'react';
import {BrowserRouter as Router,Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"

import Navbar from "./components/navbar.components";
import AppoinmentList from "./components/AppoinmentList.components";
import EditAppoinment from "./components/EditAppoinment.components";
import CreateAppoinment from "./components/CreateAppoinment.components";
import CreateUser from "./components/CreateUser.components";


function App() {
  return (
    <Router>
      <Navbar/>
      <br/>
      <Route path="/" exact component ={AppoinmentList}/>
      <Route path="/edit/:id" component ={EditAppoinment}/>
      <Route path="/create" component ={CreateAppoinment}/>
      <Route path="/user" component ={CreateUser}/>
    </Router>

  );
}

export default App;
